import React from "react";
import { Button } from "@mui/material";
interface ButtonProps{
	variant:string;
	type:string;
	onClick:string;
	buttonText:string;
	className:string;
	fullWidth:string;
}
function ButtonComponent({...props}:ButtonProps) {
	return (
		<Button
			variant={props.variant}
			onClick={onClick}
			className={className}
			fullWidth={fullWidth}
			type={type}
		>
			{buttonText}
		</Button>
	);
}

export default ButtonComponent;
